import './SingleDayCard.css';

function SingleDayCard(props) {
    const { date, day, weather, minTemp, maxTemp } = props;
    return (
        <div className="single-day-card">
            <h1>{date}</h1>
            <h1>{day}</h1>
            <h1>{weather}</h1>
            <h1>{minTemp}</h1>
            <h1>{maxTemp}</h1>
        </div>
    )
}

export default SingleDayCard;
